<!DOCTYPE html>
<html>
<head>
    <title>Bot Console</title>
    <meta name="viewport" content="width=device-width, initial-scale=1">
   <meta http-equiv="Content-Type" content="text/html; charset=utf-8" />
   <meta name="robots" content="noindex, nofollow">
   <meta name="description" content="Replit Console">
   <meta name="keywords" content="Replit, Console, Bot, Discord, Bot Console, Websocket, Socket.io, Client, Server, MiraiBot">
    <style>
        body {
            margin: 0;
            padding: 0;
            height: 100vh;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            transition: background-color 0.3s ease, color 0.3s ease;
      background-size: cover;
      background-repeat: no-repeat;
      background-position: center;
      color: white; 
        }

        body.dark-mode {
            background-color: #1C2333;
            color: white;
        }

        body.light-mode {
            background-color: white;
            color: black;
        }

       #console-container {
    width: 100%; 
    max-width: 600px; 
    height: 300px; 
    overflow-x: auto;
    overflow-y: auto;
    padding: 20px;
    background-color: #2C384A;
    color: white;
    border-radius: 10px;
    box-shadow: 0 0 10px rgba(0, 0, 0, 0.5);
    font-family: monospace;
    white-space: nowrap;
    margin-bottom: 80px; 
}

@media screen and (max-width: 768px) {
    #console-container {
        max-width: 90%; 
        height: 200px; 
        margin-bottom: 40px; 
    }
}


        #console {
            margin: 0;
            padding: 0;
        }

        pre {
            white-space: pre-wrap;
            margin: 0;
        }

        #mode-switch-container {
            position: fixed;
            bottom: 50px;
            right: 30px;
            z-index: 1; 
        }

        #mode-switch-button {
            background-color: transparent;
            border: none;
            padding: 0;
            font-size: 24px;
            cursor: pointer;
            transition: transform 0.3s ease;
        }

        #mode-icon {
            transition: transform 0.3s ease;
        }

        #full-screen-button {
            position: absolute;
            top: 10px;
            right: 10px;
            background-color: #006400;
            color: white;
            border: none;
            padding: 10px 20px;
            border-radius: 5px;
            cursor: pointer;
        }
    </style>
</head>
<body class="dark-mode">
    <button id="full-screen-button" onclick="toggleFullScreen()">Full Screen</button>
    <div id="mode-switch-container">
        <button id="mode-switch-button" onclick="toggleDarkMode()">
            <span id="mode-icon"></span>
        </button>
    </div>

    <div id="console-container">
        <pre id="console"></pre>
    </div>
